import React from "react";
import "./Toolbar.css";

const Toolbar = () => {
  return (
    <div className="container-toolbar">
      {/* <div className="container-items"> */}
      <div class="toolbar-div1 toolbar-flex">
        <img src="assets/logo.png" alt="logo" />
      </div>
      <div class="toolbar-div2 ">
        <img src="assets/phone.png" alt="logo" />
        <span>(11)3569-3465</span>
      </div>
      <div class="toolbar-div3">
        <img src="assets/user.png" alt="logo" />
        <span>User Test</span>
      </div>
      {/* </div> */}
    </div>
  );
};

export default Toolbar;
